    if (trimmed.startsWith('ls ')) {
        const parts = trimmed.split(/\s+/);
        const path = parts[parts.length - 1];
        return {
            action: 'list',
            path
        };
    }
    // find command
    if (trimmed.startsWith('find ')) {
        const match = trimmed.match(/find\s+(\S+)/);
        if (match) {
            return {
                action: 'find',
                path: match[1]
            };
        }
    }
