    if (trimmed.startsWith('grep ')) {
        const parts = trimmed.split(/\s+/);
        const path = parts[parts.length - 1];
        return {
            action: 'search',
            path
        };
    }
    // mkdir command
    if (trimmed.startsWith('mkdir ')) {
        const path = trimmed.replace(/mkdir\s+(-p\s+)?/, '').trim();
        return {
            action: 'mkdir',
            path
        };
    }
