    if (trimmed.startsWith('cp ')) {
        const parts = trimmed.replace(/cp\s+(-r\s+)?/, '').trim().split(/\s+/);
        if (parts.length >= 2) {
            return {
                action: 'copy',
                path: parts[0],
                destination: parts[1]
            };
        }
    }
    // mv command
    if (trimmed.startsWith('mv ')) {
        const parts = trimmed.slice(3).trim().split(/\s+/);
        if (parts.length >= 2) {
            return {
                action: 'move',
                path: parts[0],
                destination: parts[1]
            };
        }
    }
